import React from 'react';
import Jayalogo from "../assets/logo3.png";
import Bdlogo from '../assets/BD.png';


const Header = () => {
  return (
    <header className="sticky top-0 bg-white shadow-md  z-50">
     
      <nav className="flex bg-blue-800 justify-between items-center px-14 py-2">
       <img src={Jayalogo} alt="" className=" h-12" />
        <ul className="flex space-x-4 items-center text-white font-sans text-sm   ">
          <button className='border border-white px-4 py-2 outline-none rounded-sm'>প্রবেশ করুন</button>
          <button className='bg-orange-600 px-8  py-2 rounded-sm'>নিবন্ধন</button>
          <span className='font-semibold border flex it flex-row  border-green-600'>
            <span>
            <img src={ Bdlogo} alt="" className='h-3' />
            </span>
        
           
            <span className=''>৳</span>
             BDT Bengali
            </span>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
